function TermModal({setModalOpen1, setSectionDisplay, setBgc}) {
  const closeModal = () =>{
    setModalOpen1(false);
    setSectionDisplay('block')
    setBgc('#ffffff')
  }
  return (
    <>
      <div className="body">
        <div className="modal-wrap">
          <div className="modal-title">
            <button className="modal-closebtn" onClick={closeModal}>x</button>
            <h5 className="modal-title-content">&#91;BoardHub&#93; 서비스 이용약관</h5>
          </div>
          <div className="modal-body">
            <h3>BoardHub 서비스 이용약관</h3>
            <p><strong>제1조 목적</strong><br/>
이 약관은 ㈜스마일게이트홀딩스(이하 “회사”)가 온라인으로 제공하는 STOVE 및 이에 부수된 제반 서비스(이하 “서비스”)의 이용과 관련하여 “회사”와 “이용자” 간의 권리, 의무 및 책임사항, 기타 필요한 사항을 규정함을 목적으로 합니다.</p>
          </div>
        </div>
      </div>
    </>
  );
}

export default TermModal;
